listingDescription.message:
AudD विस्तार स्थापित करा आणि सध्याच्या टॅबवर प्ले होत असलेले गाणे ओळखण्यासाठी त्याच्या चिन्हावर क्लिक करा.
ते कसे कार्य करते हे पाहण्यासाठी वरील व्हिडिओ पहा.

AudD विस्तार:
- आपल्या ब्राउझरमध्ये वाजणारे संगीत ओळखते;
- संगीत ओळख तंत्रज्ञान वापरून 65 दशलक्षाहून अधिक गाण्यांसह AudD डेटाबेसमध्ये संगीत शोधते;
- ओळखलेल्या गाण्यांचे बोल दाखवते;
- Apple Music, Spotify, Deezer, YouTube Music वर गाणी ऐकण्यासाठी लिंक्स दाखवते;
- ब्राउझरमधून आवाज वाजल्यावर ओळखल्या जाणार्‍या गाण्यातील अचूक क्षण प्रदर्शित करते.

संगीत ओळख API: https://audd.io
स्त्रोत कोड: https://github.com/AudDMusic/chrome-extension

AudD® संगीत ओळख API द्वारे समर्थित विस्तार

Eric Stark, Mitchell Kossoris आणि Ivan Kasatkin यांच्या मदतीने AudD.io टीमने तयार केले आणि डिझाइन केले.
